import { Link } from "react-router-dom";

const LandingPage = () => {
  return (
    <div>
      <h1>Welcome to collaboration tool</h1>
      <p>You are not logged in</p>
      <button><Link to="/login"></Link></button>
      <button>Register</button>
    </div>
  );
};

export default LandingPage;
